import React from "react";
import "./Section1.scss";

const Section1 = props => {
  return (
    <div>
      <h2>Todo List</h2>
      <input type="checkbox" id="toggle" />
      <label for="toggle" className="btn" />
      <input
        type="text"
        placeholder="Input task here..."
        className="textInput"
      />
    </div>
  );
};

export default Section1;
